If(
    CmbOrgCreate.Selected.Value <> LookUp(
        AllRiskAssessmentsSettings,
        'Risk Assessment Setting' = lblSelectedAssessmentSettingId
    ).'Org Create',
    If(
        CountRows(
            Filter(
                col_temp_prvRisk,
                ItemKey = "Org Create"
            )
        ) > 0,
        Patch(
            col_temp_prvRisk,
            LookUp(
                col_temp_prvRisk,
                ItemKey = "Org Create"
            ),
            {ItemValue: CmbOrgCreate.Selected.Value}
        ),
        Patch(
            col_temp_prvRisk,
            Defaults(col_temp_prvRisk),
            {
                ItemKey: "Org Create",
                ItemValue: CmbOrgCreate.Selected.Value
            }
        )
    ),
    RemoveIf(
        col_temp_prvRisk,
        CountRows(
            Filter(
                col_temp_prvRisk,
                ItemKey = "Org Create"
            )
        ) > 0,
        ItemKey = "Org Create"
    );

);


If(
    CountRows(col_temp_prvRisk) > 1,
    UpdateContext({isRiskLevelChanged: true}),
    UpdateContext({isRiskLevelChanged: false})
);

If(
    CmbBUCreate.Selected.Value <> 
        LookUp(
                AllRiskAssessmentsSettings,
                'Risk Assessment Setting' = lblSelectedAssessmentSettingId
            
        ).'BU Create'
    ,
    If(
        CountRows(
            Filter(
                col_temp_prvRisk,
                ItemKey = "User Create"
            )
        ) > 0,
        Patch(
            col_temp_prvRisk,
            LookUp(
                col_temp_prvRisk,
                ItemKey = "User Create"
            ),
            {ItemValue: CmbBUCreate.Selected.Value}
        ),
        Patch(
            col_temp_prvRisk,
            Defaults(col_temp_prvRisk),
            {
                ItemKey: "User Create",
                ItemValue: CmbBUCreate.Selected.Value
            }
        )
    ),
    RemoveIf(
        col_temp_prvRisk,
        CountRows(
            Filter(
                col_temp_prvRisk,
                ItemKey = "User Create"
            )
        ) > 0,
        ItemKey = "User Create"
    );
    
);
If(
    CountRows(col_temp_prvRisk) > 1,
    UpdateContext({isRiskLevelChanged: true}),
    UpdateContext({isRiskLevelChanged: false})
);

Switch(
    Self.Selected.ItemKey,
    /* Action for Key 'new' */
    "save",
    UpdateContext(
        {
            init: false,
            spinnerColorForSettings: RGBA(
                255,
                255,
                255,
                0.7
            ),
            spinnerLabelForSettings: DVAssessmentPageLoc.pleaseWaitLoadingText
        }
    );
    If(
        IsBlankOrError(txtNameInput.Value),
        Notify(
            DVAssessmentPageLoc.nameFieldRequiredText,
            NotificationType.Error,
            5000
        ),
        isNewButtonClicked && IsBlank(DefaultRiskAssessmentSetting) &&  CountRows(col_temp_prvRisk) <> 33,
        Notify(
            DVAssessmentPageLoc.privilegesValidationErrorText,
            NotificationType.Error,
            5000
        ),
        UpdateContext({postSettingsData: true});
    );
    If(
        postSettingsData,
        UpdateContext(
            {
                init: false,
                spinnerLabelForSettings: DVAssessmentPageLoc.savingLoaderText,
                ctxAssessmentSettingsEvent: "ClearSelection" & Text(Rand())
            }
        );
        UpdateContext(
            {
                lblSelectedAssessmentSettingId: Patch(
                    'Risk Assessment Settings',
                    If(
                        isNewButtonClicked,
                        Defaults('Risk Assessment Settings'),
                        LookUp(
                            AllRiskAssessmentsSettings,
                            'Risk Assessment Setting' = lblSelectedAssessmentSettingId
                        )
                    ),
                    {
                        Name: txtNameInput.Value,
                        Description: txtDescriptionInput.Value,
                        'Org Create': CmbOrgCreate.Selected.Value,
                        'PCBU Create': CmbPCBUCreate.Selected.Value,
                        'BU Create': CmbBUCreate.Selected.Value,
                        'User Create': CmbUserCreate.Selected.Value,
                        'Org Read': CmbOrgRead.Selected.Value,
                        'PCBU Read': CmbPCBURead.Selected.Value,
                        'BU Read': CmbBURead.Selected.Value,
                        'User Read': CmbUserRead.Selected.Value,
                        'Org Write': CmbOrgUpdate.Selected.Value,
                        'PCBU Write': CmbPCBUUpdate.Selected.Value,
                        'BU Write': CmbBUUpdate.Selected.Value,
                        'User Write': CmbUserUpdate.Selected.Value,
                        'Org Delete': CmbOrgDelete.Selected.Value,
                        'PCBU Delete': CmbPCBUDelete.Selected.Value,
                        'BU Delete': CmbBUDelete.Selected.Value,
                        'User Delete': CmbUserDelete.Selected.Value,
                        'Org Append': CmbOrgAppend.Selected.Value,
                        'PCBU Append': CmbPCBUAppend.Selected.Value,
                        'BU Append': CmbBUAppend.Selected.Value,
                        'User Append': CmbUserAppend.Selected.Value,
                        'Org Append To': CmbOrgAppendTo.Selected.Value,
                        'PCBU Append To': CmbPCBUAppendTo.Selected.Value,
                        'BU Append To': CmbBUAppendTo.Selected.Value,
                        'User Append To': CmbUserAppendTo.Selected.Value,
                        'Org Assign': CmbOrgAssign.Selected.Value,
                        'PCBU Assign': CmbPCBUAssign.Selected.Value,
                        'BU Assign': CmbBUAssign.Selected.Value,
                        'User Assign': CmbUserAssign.Selected.Value,
                        'Org Share': CmbOrgShare.Selected.Value,
                        'PCBU Share': CmbPCBUShare.Selected.Value,
                        'BU Share': CmbBUShare.Selected.Value,
                        'User Share': CmbUserShare.Selected.Value
                    }
                ).'Risk Assessment Setting'
            }
        );
        If(
     // check if there were any errors when the risk assessment setting was submitted
            !IsEmpty(Errors('Risk Assessment Settings')),
     // if true, show any error message
            Notify(
                Concat(
                    Errors('Risk Assessment Settings'),
                    Column & ": " & Message
                ),
                NotificationType.Error,
                11111
            );
            UpdateContext(
                {
                    init: true,
                    spinnerLabelForSettings: Blank(),
                    spinnerColorForSettings: Blank()
                }
            ),
            Notify(
                DVAssessmentPageLoc.saveSettingsSuccessMessage,
                NotificationType.Success,
                5000
            );
            ClearCollect(
                col_temp_prvRisk,
                Table(
                    {
                        ItemKey: "test",
                        ItemValue: 0
                    }
                )
            );
            UpdateContext(
                {
                    lblName: txtNameInput.Value,
                    lblDescription: txtDescriptionInput.Value,
                    isRiskLevelChanged: false,
                    isDescriptionValueChanged: false,
                    isNameValueChanged: false
                }
            );
            If(
                isNewButtonClicked,
                Set(
                    isNewButtonClicked,
                    false
                ),
                true
            );
        ),
        true
    );
    UpdateContext({postSettingsData: false});
    UpdateContext(
        {
            init: true,
            spinnerColorForSettings: Blank(),
            spinnerLabelForSettings: Blank()
        }
    );
    false,
    "cancel",
    UpdateContext(
        {
            lblName: "",
            lblDescription: "",
            isRiskLevelChanged: false,
            isDescriptionValueChanged: false,
            isNameValueChanged: false
        }
    );
    Concurrent(
        Reset(txtNameInput),
        Reset(txtDescriptionInput),
        Reset(CmbOrgCreate),
        Reset(CmbPCBUCreate),
        Reset(CmbBUCreate),
        Reset(CmbUserCreate),
        Reset(CmbOrgRead),
        Reset(CmbPCBURead),
        Reset(CmbBURead),
        Reset(CmbUserRead),
        Reset(CmbOrgUpdate),
        Reset(CmbPCBUUpdate),
        Reset(CmbBUUpdate),
        Reset(CmbUserUpdate),
        Reset(CmbOrgDelete),
        Reset(CmbPCBUDelete),
        Reset(CmbBUDelete),
        Reset(CmbUserDelete),
        Reset(CmbOrgAppend),
        Reset(CmbPCBUAppend),
        Reset(CmbBUAppend),
        Reset(CmbUserAppend),
        Reset(CmbOrgAppendTo),
        Reset(CmbPCBUAppendTo),
        Reset(CmbBUAppendTo),
        Reset(CmbUserAppendTo),
        Reset(CmbOrgAssign),
        Reset(CmbPCBUAssign),
        Reset(CmbBUAssign),
        Reset(CmbUserAssign),
        Reset(CmbOrgShare),
        Reset(CmbPCBUShare),
        Reset(CmbBUShare),
        Reset(CmbUserShare),
        ClearCollect(
            col_temp_prvRisk,
            Table(
                {
                    ItemKey: "test",
                    ItemValue: 0
                }
            )
        );
    );
    ,
    /* Default action */
    false
)
